import React, { useState } from "react";
import SearchResult from './SearchResult';
const Search=()=>{
    const[img, Upimg]=useState();
    const thisVal=(obj)=>{
        const vl=obj.target.value;
        Upimg(vl);
    }

  return(
    <>
    <div className="mx-auto">
    <input value={img} onChange={thisVal} placeholder="Search images"/>
    <SearchResult name={img}/>
    </div>
    </>
  )
}
export default Search;
